/* Generated File Run.js in Project coba */	function close_coba(){	Minimizer.close("coba");}	function minimize_coba(){	Minimizer.minimize("coba");}	function maximize_coba(){	Minimizer.maximize("coba");}function open_coba(){}/* Initialize application */			function init_coba(){	$("#body-coba").keypress(function(event) {	}).mouseover(function(){	    $("#coba-container").draggable({disabled:true});    }).mouseout(function(){        $("#coba-container").draggable({disabled:false});    });		$("#coba-container").mousedown(function(){		Focus.set("coba");		setMenu_coba();			fixSizecobaSpeed = 0;	})	.mouseup(function(){		fixSizecobaSpeed = 300;	});		/* Make application resizable */	Resizable.set("coba");		$("#exit-coba").mousedown(function(){		close_coba();		$("#body-coba").val("");	});	$("#maximize-coba").mousedown(function(){		maximize_coba()	});		$("#minimize-coba").mousedown(function(){		minimize_coba()	});        $("#coba-button1").click(function(){       //MessageBox.show("Hello", "Hello World");        a = $("#coba-textbox1").val();       b = $("#coba-textbox2").val();       c = a + b;       MessageBox.show("Hello", "Hasil:"+c);        $("#coba-textbox3").val(c);    });			fixSize_coba();}/* Fix size application */var fixSizecobaSpeed = 300;function fixSize_coba(){	setTimeout(function(){		if(LoadAppsID["coba"].onFocus){			height = $("#coba-container").height();			width = $("#coba-container").width();			$("#body-coba").css({"height" : height-45, "width" : width-5});		}		fixSize_coba();	},fixSizecobaSpeed);}/* Set application menu */function setMenu_coba(){	proIdApps = "coba";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>Coba</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_coba(proIdApps)>Minimize</li>"+			"<li onclick=maximize_coba(proIdApps)>Maximize</li>"+			"<li onclick=close_coba(proIdApps)>Quit Coba</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_coba(){	$.post("system/applications/coba/layout/coba.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_coba,100);		fixSize_coba();		applicationOpened++;	});	}/* Running application */function run_coba(dir, fileName){}